import React from 'react'
import {GitHub,LinkedIn,Instagram,Email,Facebook} from '@material-ui/icons';
import Link from '@material-ui/core/Link';
// import LinkedInIcon from '@material-ui/icons/LinkedIn';
// import InstagramIcon from '@material-ui/icons/Instagram';
// import EmailIcon from '@material-ui/icons/Email';
// import FacebookIcon from '@material-ui/icons/Facebook';
function Footer(){
    return (
        <div className="bottom-container">
      <div className="copyright"> &copy;{new Date().getFullYear()} Peris Chepkemoi</div> 
      <Link href="#" onClick={preventDefault}>
    Link
  </Link>
     <GitHub /> 
     <LinkedIn />
     <Instagram/>
     <Email />
     <Facebook />
     <a
        className="footer-link"
        href="https://www.linkedin.com/in/peris-chepkemoi-410876120/"
        target="_blank"
        >LinkedIn</a
      >
      <a
        className="footer-link"
        href="https://twitter.com/perissherlyn"
        target="_blank"
        >Twitter</a>
      
   </div>
     
    )
}
export default Footer
